import React, { useState, useEffect } from "react";
import { RouterProvider, Route } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

import AuthService from "./services/auth.service";
import Login from "./components/newLogin.js";
import Register from "./components/Register.js";
import Registration from "./components/Registration";
import Home from "./components/Home.js";
import Profile from "./components/Profile.js";
import BoardUser from "./components/boardUser.js";
import BoardModerator from "./components/boardModerator.js";
import BoardAdmin from "./components/boardAdmin.js";
import Animals from './components/Animals';
import AnimalItem from './components/AnimalItem';
import Page404 from './components/Page404';
import { getAllAnimals, getOneAnimal } from './components/api';
import CreateForm from './components/CreateForm';
import EditForm from './components/EditForm';
import CreateCategories from './components/CreateCategories';
import BlogPage from './components/Blog.js';
import OnePost from "./components/OnePost.js";
import CreatePost from "./components/CreatePost.js";
import EditPost from "./components/EditPost.js";

const App = () => {
  const [currentUser, setCurrentUser] = useState(undefined);
  const [showModeratorBoard, setShowModeratorBoard] = useState(false);
  const [showAdminBoard, setShowAdminBoard] = useState(false);

  useEffect(() => {
    const user = AuthService.getCurrentUser();
    if (user) {
      setCurrentUser(user);
      setShowModeratorBoard(user.roles.includes("ROLE_MODERATOR"));
      setShowAdminBoard(user.roles.includes("ROLE_ADMIN"));
    }
  }, []);

  const logOut = () => {
    AuthService.logout();
    setShowModeratorBoard(false);
    setShowAdminBoard(false);
    setCurrentUser(undefined);
  };

  return (
    <RouterProvider>
      <div>
        <nav className="navbar navbar-expand navbar-dark bg-dark">
          {/* Your navigation links */}
        </nav>

        <Route
          path="/"
          element={<Home />}
        />
        <Route
          path="/animal/add"
          element={<CreateForm />}
        />
        <Route
          path="/categories"
          element={<CreateCategories />}
        />
        <Route
          path="/categories/create"
          element={<CreateCategories />}
        />
        <Route
          path="/animals/category/:catId?"
          element={<Animals />}
        />
        <Route
          path="/animals"
          element={<Animals />}
          loader={getAllAnimals}
        >
          <Route
            path=":animalId"
            element={<AnimalItem />}
            loader={async ({params}) => getOneAnimal(params.animalId)}
          />
        </Route>
        <Route
          path="/animals/:animalId/edit"
          element={<EditForm />}
        />
        <Route
          path="/login"
          element={<Login />}
        />
        <Route
          path="/register"
          element={<Register />}
        />
        <Route
          path="/registration"
          element={<Registration />}
        />
        <Route
          path="/profile"
          element={<Profile />}
        />
        <Route
          path="/user"
          element={<BoardUser />}
        />
        <Route
          path="/mod"
          element={<BoardModerator />}
        />
        <Route
          path="/admin"
          element={<BoardAdmin />}
        />
        <Route
          path="/blog"
          element={<BlogPage />}
        />
        <Route
          path="/posts/:postId"
          element={<OnePost />}
        />
        <Route
          path="/post/create"
          element={<CreatePost />}
        />
        <Route
          path="/posts/:postId/edit"
          element={<EditPost />}
        />
        <Route
          path="*"
          element={<Page404 />}
        />
      </div>
    </RouterProvider>
  );
}

export default App;
